  TID_MODULE_ROCKET_LAUNCHER_DESCR: "폭격기 섹터나 인접 섹터에 함선을 보유한 적 플레이어에게 1개의 폭격기 로켓을 발사합니다. 각 로켓은 가장 가까운 적 플레이어의 함선을 향해 날아갑니다.",
  TID_BOMBER_ROCKET_DESCR: "강력한 로켓으로, 목표물 주위에 위치한 모든 플레이어 함선에 광역 피해 이 로켓은 목표물에 도달하기 전 무력화되더라도 여전히 목표보다 좁은 범위 내에 가벼운 광역 피해를 입힐 수 있습니다.",
  TID_MODULE_DART_LAUNCHER: "다트 런처",
